re using their smart devices. The insights I discover will then help guide marketing strategy for the company.\n","\n","I chose to focus on the BellaBeat app and will provide recommendations for how to improve it based on my findings.\n"]},{"cell_type":"markdown","id":"84fc92c2","metadata":{"papermill":{"duration":0.010111,"end_time":"2023-11-14T17:28:24.220188","exception":false,"start_time":"2023-11-14T17:28:24.210077","status":"completed"},"tags":[]},"source":["# Clean <a class=\"anchor\"  id=\"clean\"></a>\n"]},{"cell_type":"markdown","id":"78bb070e","metadata":{"papermill":{"duration":0.009645,"end_time":"2023-11-14T17:28:24.23974","exception":false,"start_time":"2023-11-14T17:28:24.230095","status":"completed"},"tags":[]},"source":["I will be analyzing the [FitBit Fitness Tracker Data](https://www.kaggle.com/datasets/arashnic/fitbit). This dataset was \"generated by respondents to a distributed survey via Amazon Mechanical Turk between 03.12.2016-05.12.2016. Thirty eligible Fitbit users consented to the submission of personal tracker data, including minute-level output for physical activity, heart rate, and sleep monitoring\"."]},{"cell_type":"markdown","id":"c7fb5ed0","metadata":{"papermill":{"duration":0.009672,"end_time":"2023-11-14T17:28:24.260252","exception":false,"start_time":"2023-11-14T17:28:24.25058","status":"completed"},"tags":[]},"source":[]},{"cell_type":"markdown","id":"0e218e29","metadata":{"papermill":{"duration":0.009767,"end_time":"2023-11-14T17:28:24.279623","exception":false,"start_time":"2023-11-14T17:28:24.269856","status":"completed"},"tags":[]},"source":["#### Load packages"]},{"cell_type":"code","execution_count":1,"id":"8fd616ff","metadata":{"execution":{"iopub.execute_input":"2023-11-14T17:28:24.304663Z","iopub.status.busy":"2023-11-14T17:28:24.302001Z","iopub.status.idle":"2023-11-14T17:28:25.656595Z","shell.execute_reply":"2023-11-14T17:28:25.654567Z"},"papermill":{"duration":1.369764,"end_time":"2023-11-14T17:28:25.659659","excep