average number of hours asleep is only 6.99. On top of this, sleeping fewer hours was associated with increased sedentary minutes.\n","\n","In order to encourage users to sleep at least 8 hours, the app should emphasize sleep by creating a tab dedicated to sleep. This tab should provide tips for proper sleep hygiene, the importance of sleep, as well as automated alerts when it is time to sleep and wake up.\n","\n","* Higher sedentary minutes and sleeping too many hours (>10 hours) was also associated with taking fewer steps. \n","\n","Therefore, the BellaBeat app could have an option for users to set a goal for daily steps (at least 10,000) to incentivize and make users aware of the benefits of taking more steps. They should also inform users that a healthy sleeping range is vital to being more active.\n","\n","#### Note\n","\n","In order to draw further conclusions, more data would be needed. Specifically, we would need a larger sample size, and we would need it to reflect the population by accounting for other variables such as age, race, socioeconomic status, previous health conditions, etc. The data gathered should also be more extensive, daily weight measurments performed at the same time, qualitative data for stress, number of mindfulness minutes each day, etc. From this data I would analyze it to uncover any correlations, from there I would research these correlations to see if any RCT's have been conducted to support causality.\n"]}],"metadata":{"kernelspec":{"display_name":"R","language":"R","name":"ir"},"language_info":{"codemirror_mode":"r","file_extension":".r","mimetype":"text/x-r-source","name":"R","pygments_lexer":"r","version":"4.0.5"},"papermill":{"default_parameters":{},"duration":8.638484,"end_time":"2023-11-14T17:28:28.963796","environment_variables":{},"exception":null,"input_path":"__notebook__.ipynb","output_path":"__notebook__.ipynb","parameters":{},"start_time":"2023-11-14T17:28:20.325312","version":"2.4.0"}},"nbformat":4,"nbformat_minor":5}